import React, { Component } from 'react'

 class Contact extends Component {
  render() {
    return (
      <div>
          <h3>{this.props.name}</h3>
          <ul>
              <li>email  = 33</li>
              <li>phone = 33</li>
          </ul>
      </div>
    )
  }
}
export default Contact ;
